import { useNavigate } from "react-router-dom";
import TopBar from "../TopBar.jsx";
import Fog from "../../../components/Fog";
import { Textfit } from "react-textfit";
import Blook from "../../../blooks/Blook";
import Alert from "../../../components/Alert";
import { NodeGroup } from "react-move";
import { useAuth } from "../../../context/AuthContext";
import Standings from "./Standings";
import Modal from "../../../components/Modal";

const images = {
    arch: "data:image/svg+xml;base64,",
    candle1: "data:image/svg+xml;base64,",
    candle2: "data:image/svg+xml;base64,",
    candle3: "data:image/svg+xml;base64,",
    cracksBottom: "data:image/svg+xml;base64,",
    cracksLeft: "data:image/svg+xml;base64,",
    cracksLeft2: "data:image/svg+xml;base64,",
    cracksRight: "data:image/svg+xml;base64,",
    cracksTop: "data:image/svg+xml;base64,",
    cracksTop2: "data:image/svg+xml;base64,",
    spiderweb: "data:image/svg+xml;base64,",
    candy: "data:image/svg+xml;base64,",
    gold: "data:image/svg+xml;base64,",
    castleTile: "data:image/svg+xml;base64,"
}

export function GoldInstruct() {
    const { host: { current: host }, updateHost, liveGameController } = useGame();
    const { current: audio } = useRef(new Audio(holidays.halloween ? audios.candyQuest : audios.goldQuest));
    const [muted, setMuted] = useState(!!host && host.muted);
    const timeout = useRef();
    const navigate = useNavigate();
    const skip = useCallback(() => navigate("/host/gold"), []);
    const changeMuted = useCallback(() => {
        setMuted(!muted);
        audio.muted = !muted;
        updateHost({ muted: !muted });
    }, [muted])
    useEffect(() => {
        if (host?.settings) {
            import("./gold.css");
            audio.volume = 0.45;
            audio.play();
            audio.addEventListener("ended", function () {
                audio.currentTime = 0;
                audio.play();
            }, false);
            timeout.current = setTimeout(skip, 14500);
        }
        return () => {
            clearTimeout(timeout.current);
            audio.currentTime = 0;
            audio.pause();
            audio.removeEventListener("ended", function () {
                audio.currentTime = 0;
                audio.play();
            }, false);
        }
    }, []);
    if (!host?.settings) return navigate("/sets");
    return <div className="body">
        <TopBar left={host.settings.lateJoin ? `ID: ${liveGameController.liveGameCode}` : ""} center="Instructions" muted={muted} changeMuted={changeMuted} />
        <div className="regularBody">
            <div className="container" style={{
                backgroundImage: holidays.halloween ? null : `url(${images.castleTile})`,
                backgroundColor: holidays.halloween ? "#292929" : null,
                backgroundSize: 74.5
            }}>
                <div className="text n1">Answer Questions</div>
                <div className="text n2">Select Chests</div>
                <div className="text n3">Collect {holidays.halloween ? "Candy" : "Gold"}</div>
                <div className="text n4">Take {holidays.halloween ? "Candy" : "Gold"} From Others</div>
                <div className="text n5">
                    {host.settings.mode == "Time"
                        ? `Most ${holidays.halloween ? "candy" : "gold"} after ${formatNumber(host.settings.amount)} minute${host.settings.amount == 1 ? "s" : ""} wins!`
                        : `First player to have ${formatNumber(host.settings.amount)} ${holidays.halloween ? "Candy" : "Gold"} wins!`}
                </div>
                <div className="text n6">Good Luck!</div>
            </div>
        </div>
        <div id="skipButton" onClick={skip}>Skip</div>
    </div>
}

export default function GoldHost() {
    const { host: { current: host }, liveGameController, updateHost, updateStandings } = useGame();
    const [timer, setTimer] = useState("00:00");
    const [players, setPlayers] = useState([]);
    const [alerts, setAlerts] = useState([]);
    const [totalGold, setTotalGold] = useState(0);
    const [muted, setMuted] = useState(!!host?.muted);
    const [userToBlock, setUserToBlock] = useState("");
    const dbRef = useRef();
    const lastClients = useRef({});
    const navigate = useNavigate();
    const endGame = useRef(false);
    const getClients = useCallback(() => {
        window.dispatchEvent(new Event('resize')); // Fix React-Textfit not sizing right
        liveGameController.getDatabaseVal("c", snapshot => {
            const val = snapshot || {};
            if (!val || Object.keys(val).length == 0) return setPlayers([]);
            let clients = [];
            for (const [name, { b: blook, g: gold = 0 }] of Object.entries(val)) clients.push({ name, blook, gold: gold || 0 });
            clients.sort((a, b) => b.gold - a.gold);
            setPlayers(clients);
        });
    }, []);
    const goNext = useCallback(() => {
        let val = players.map((s, i) => ({
            n: s.name,
            b: s.blook,
            g: s.gold,
            p: i + 1
        }));
        updateStandings(val);
        liveGameController.setVal({
            path: "st", val
        }, () => liveGameController.setStage({ stage: "fin" }, () => navigate("/host/gold/final")));
    }, [players]);
    const addAlert = useCallback((name, blook, msg, info) => {
        setAlerts(a => a.find(e => e.name + e.msg == name + msg) ? a : [...a, { name, blook, msg, info }])
    }, []);
    const changeMuted = useCallback(() => {
        setMuted(!muted);
    }, [muted]);
    useEffect(() => {
        audio.muted = muted;
        updateHost({ muted });
    }, [muted]);
    const blockUser = useCallback(() => {
        liveGameController.blockUser(userToBlock);
        setPlayers(players.filter(({ name }) => name != userToBlock));
        setUserToBlock("");
    }, [userToBlock, players]);
    const { current: audio } = useRef(new Audio(holidays.halloween ? audios.candyQuest : audios.goldQuest));
    const timerInterval = useRef();
    const clientsInterval = useRef();
    useEffect(() => {
        import("./gold.css");
        if (!host?.settings) return navigate("/sets");
        window.liveGameController = liveGameController;
        (async () => {
            audio.muted = muted;
            audio.volume = 0.4;
            audio.play();
            audio.addEventListener("ended", () => {
                audio.currentTime = 0;
                audio.play();
            }, false);
            liveGameController.setStage({ stage: "gold" });
            getClients();
            if (host.settings.mode == "Time") {
                let seconds = 60 * host.settings.amount;
                setTimer(`${Math.floor(seconds / 60)}:${String(seconds % 60).padStart(2, "0")}`);
                timerInterval.current = setInterval(() => {
                    seconds--;
                    setTimer(`${Math.floor(seconds / 60)}:${String(seconds % 60).padStart(2, "0")}`);
                    getClients();
                    if (seconds <= 0) {
                        clearInterval(timerInterval.current);
                        endGame.current = true;
                    }
                }, 1000);
            } else timerInterval.current = setInterval(getClients, 1000);
            dbRef.current = await liveGameController.getDatabaseRef("c");
            dbRef.current.on("value", function (snapshot) {
                const clients = snapshot.val() || {};
                const changed = diffObjects(lastClients.current, clients) || {};
                for (const [client, data] of Object.entries(changed)) if (data.tat) {
                    const [tat, type, amount] = data.tat.split(":");
                    const r = clients[tat];
                    if (!r) continue;
                    if (type == "swap") {
                        if (!amount || tat == client) continue;
                        liveGameController.setVal({
                            path: `c/${tat}`,
                            val: {
                                b: r.b,
                                g: parseInt(amount),
                                at: `${client}:${clients[client].b}:swap:${amount}`
                            }
                        });
                        clients[tat].g = parseInt(amount);
                        addAlert(client, clients[client].b, `just swapped ${holidays.halloween ? "candy" : "gold"} with ${tat}`);
                    } else {
                        if (!type) continue;
                        liveGameController.setVal({
                            path: `c/${tat}`,
                            val: {
                                b: r.b,
                                g: Math.max((r.g || 0) - parseInt(type), 0),
                                at: `${client}:${clients[client].b}:${type}`
                            }
                        });
                        clients[tat].g = Math.max((r.g || 0) - parseInt(type), 0);
                        addAlert(client, clients[client].b, `just took ${formatNumber(parseInt(type))} ${holidays.halloween ? "candy" : "gold"} from ${tat}`);
                    }
                    liveGameController.removeVal(`c/${client}/tat`);
                }
                lastClients.current = clients;
                let total = 0;
                for (const client in clients) {
                    total += parseInt("0" + clients[client].g);
                    if (host.settings.mode == "Amount" && clients[client].g >= host.settings.amount) endGame.current = true;
                }
                setTotalGold(total);
            });
        })();
        return () => {
            clearInterval(timerInterval.current);
            clearInterval(clientsInterval.current);
            audio.currentTime = 0;
            audio.pause();
            audio.removeEventListener("ended", () => {
                audio.currentTime = 0;
                audio.play();
            }, false);
        }
    }, []);
    useEffect(() => {
        if (endGame.current) goNext();
    }, [players])
    if (!host?.settings) return navigate("/sets");
    return <>
        {holidays.halloween ? <div className="body" style={{ overflow: "hidden", backgroundColor: "#292929" }}>
            <TopBar left="Blooket" center={host.settings.mode == "Time" ? timer : `Goal: ${formatNumber(host.settings.amount)}`} right={host.settings.lateJoin ? `ID: ${liveGameController.liveGameCode}` : ""} muted={muted} changeMuted={() => setMuted(m => !m)} onRightClick={() => (endGame.current = true, getClients())} />
            <div className="hostRegularBody">
                <NodeGroup data={players} keyAccessor={({ name }) => name}
                    start={(_, place) => ({ x: -60, y: 12.5 * place })}
                    enter={(_, place) => ({ x: [0], y: [12.5 * place], timing: { duration: 1000, ease: e => +e } })}
                    update={(_, place) => ({ x: [0], y: [12.5 * place], timing: { duration: 500, ease: e => +e } })}
                    leave={() => ({ x: [-60], timing: 1000 })}>
                    {(standings) => <div id="spookyLeftWrapper">
                        <div className="spookyCorner1"></div>
                        <div className="spookyCorner2"></div>
                        <div className="spookyCorner3"></div>
                        <div className="spookyCorner4"></div>
                        <div id="spookyLeftBg"></div>
                        <div className="spookySpots"></div>
                        <img src={images.cracksTop2} alt="Crack" id="spookyLeftCrackTop" />
                        <img src={images.cracksLeft2} alt="Crack" id="spookyLeftCrackLeft" />
                        <div className="spookyLeft invisibleScrollbar">
                            {standings.map(({ key, data, state: { x, y } }, i) => {
                                return <div key={key} style={{
                                    opacity: userToBlock == data.name ? 0.4 : null,
                                    transform: `translate(${x}vw, ${y}vh)`
                                }} onClick={() => setUserToBlock(data.name)} className="spookyStandingContainer">
                                    <div className="spookyStandingInside">
                                        <Textfit className="placeText" mode="single" forceSingleModeWidth={false} min={1} max={getDimensions("5vw")}>{i + 1}</Textfit>
                                        <div className="superPlaceText">{getOrdinal(i + 1)}</div>
                                        <Blook name={data.blook} className="blookBox"></Blook>
                                        <Textfit className="nameText" mode="single" forceSingleModeWidth={false} min={1} max={getDimensions("4vw")}>{data.name}</Textfit>
                                        <div className="goldContainer">
                                            <Textfit className="goldText" mode="single" forceSingleModeWidth={false} min={1} max={getDimensions("5vw")}>{data.gold < 1000 ? formatNumber(data.gold) : formatBigNumber(data.gold)}</Textfit>
                                            <img src={images.candy} alt="Candy" className="candyIcon" />
                                        </div>
                                    </div>
                                </div>
                            })}
                        </div>
                    </div>}
                </NodeGroup>
                <div id="spookyRight">
                    <div className="spookyCorner1"></div>
                    <div className="spookyCorner2"></div>
                    <div className="spookyCorner3"></div>
                    <div className="spookyCorner4"></div>
                    <div id="spookyChatroom">
                        <img id="spookyArch" src={images.arch} alt="arch" />
                    </div>
                    <div id="totalCandyContainerBg"></div>
                    <div className="spookySpots"></div>
                    <img src={images.cracksTop} alt="Crack" id="spookyRightCrackTop" />
                    <img src={images.cracksRight} alt="Crack" id="spookyRightCrackRight" />
                    <img src={images.cracksBottom} alt="Crack" id="spookyRightCrackBottom" />
                    <img src={images.cracksLeft} alt="Crack" id="spookyRightCrackLeft" />
                    <div className="spookyChatroomInside invisibleScrollbar">
                        {alerts.length
                            ? alerts.map((alert, i) => <Alert key={`alert${i}`} name={alert.name} blook={alert.blook} message={alert.msg} glitchInfo={alert.info} night={true} />)
                            : <div id="noAlerts">
                                <i className="noAlertsIcon fas fa-hourglass-start" />
                                <div id="noAlertsText">Waiting To Party...</div>
                            </div>}
                    </div>
                    <div id="totalCandyContainer">
                        <div className="totalGoldText">{formatNumber(totalGold)}</div>
                        <img src={images.candy} alt="Candy" id="totalCandyIcon" />
                    </div>
                    <img src={images.candle1} alt="Candle" id="spookyCandle1" />
                    <img src={images.candle2} alt="Candle" id="spookyCandle2" />
                    <img src={images.candle3} alt="Candle" id="spookyCandle3" />
                </div>
            </div>
            <Fog />
        </div> : <div className="body" style={{
            overflow: "hidden",
            backgroundImage: `url(${images.castleTile})`,
            backgroundSize: "74.5px"
        }}>
            <TopBar left="Blooket" center={host.settings.mode == "Time" ? timer : `Goal: ${formatNumber(host.settings.amount)}`} right={host.settings.lateJoin ? `ID: ${liveGameController.liveGameCode}` : ""} muted={muted} changeMuted={changeMuted} onRightClick={() => (endGame.current = true, getClients())} />
            <div className="hostRegularBody">
                <NodeGroup data={players} keyAccessor={({ name }) => name}
                    start={(_, place) => ({ x: -60, y: 12.5 * place })}
                    enter={(_, place) => ({ x: [0], y: [12.5 * place], timing: { duration: 1000, ease: e => +e } })}
                    update={(_, place) => ({ x: [0], y: [12.5 * place], timing: { duration: 500, ease: e => +e } })}
                    leave={() => ({ x: [-60], timing: 1000 })}>
                    {(standings) => <div className="goldLeft invisibleScrollbar">
                        {standings.map(({ key, data, state: { x, y } }, i) => {
                            return <div key={key} style={{
                                opacity: userToBlock == data.name ? 0.4 : null,
                                transform: `translate(${x}vw, ${y}vh)`
                            }} onClick={() => setUserToBlock(data.name)} className={`goldStandingContainer${holidays.lucky ? " green" : ""}`}>
                                <div className={`goldStandingInside${holidays.lucky ? " green" : ""}`}>
                                    <Textfit className="placeText" mode="single" forceSingleModeWidth={false} min={1} max={getDimensions("5vw")}>{i + 1}</Textfit>
                                    <div className="superPlaceText">{getOrdinal(i + 1)}</div>
                                    <Blook name={data.blook} className="blookBox"></Blook>
                                    <Textfit className="nameText" mode="single" forceSingleModeWidth={false} min={1} max={getDimensions("4vw")}>{data.name}</Textfit>
                                    <div className="goldContainer">
                                        <Textfit className="goldText" mode="single" forceSingleModeWidth={false} min={1} max={getDimensions("5vw")}>{data.gold < 1000 ? formatNumber(data.gold) : formatBigNumber(data.gold)}</Textfit>
                                        <img src={images.gold} alt="Gold" className="goldIcon" />
                                    </div>
                                </div>
                            </div>
                        })}
                    </div>}
                </NodeGroup>
                <div className={`goldChatRoom${holidays.lucky ? " green" : ""}`}>
                    <div className={`goldChatRoomInside invisibleScrollbar${holidays.lucky ? " green" : ""}`}>
                        {alerts.length
                            ? alerts.map((alert, i) => <Alert key={`alert${i}`} name={alert.name} blook={alert.blook} message={alert.msg} glitchInfo={alert.info} night={true} />)
                            : <div id="noAlerts">
                                <i className="noAlertsIcon fas fa-hourglass-start" />
                                <div id="noAlertsText">Waiting To Party...</div>
                            </div>}
                    </div>
                </div>
                <div className={`totalGoldContainer${holidays.lucky ? " green" : ""}`}>
                    <div className={`totalGoldInside${holidays.lucky ? " green" : ""}`}>
                        <div className="totalGoldText">{formatNumber(totalGold)}</div>
                        <img src={images.gold} alt="Gold" id="totalGoldIcon" />
                    </div>
                </div>
            </div>
        </div>}
        {userToBlock && <Modal text={`Remove ${userToBlock} from the game?`}
            buttonOne={{ text: "Yes", click: blockUser, color: "#ce1313" }}
            buttonTwo={{ text: "No", click: () => setUserToBlock(""), color: "var(--accent1)" }} />}
    </>
}

export function GoldFinal() {
    const { standings: { current: standings }, liveGameController, deleteHost, host: { current: host }, hostId } = useGame();
    const { http: { post } } = useAuth();
    const [state, setState] = useState({
        standings,
        historyId: "",
        ready: false,
        muted: !!host && host.muted
    });
    const [askPlayAgain, setAskPlayAgain] = useState(false);
    const { current: hostCopy } = useRef(JSON.parse(JSON.stringify(host)));
    const navigate = useNavigate();
    const startTimeout = useRef();
    const waitTimeout = useRef();
    const askTimeout = useRef();
    const restarting = useRef(false);
    useEffect(() => {
        console.log(state, hostId);
        if (!state.standings?.[0]) return navigate("/sets");
        startTimeout.current = setTimeout(function () {
            let results = {};
            liveGameController.getDatabaseVal("c", val => {
                for (const client in (val || {})) {
                    let user = val[client];
                    results[client] = { corrects: {}, incorrects: {} };
                    if (user.i) if (Array.isArray(user.i)) for (let i = 0; i < user.i.length; i++) {
                        if (user.i[i]) results[client].incorrects[i] = user.i[i];
                    } else results[client].incorrects = user.i;

                    if (user.c) if (Array.isArray(user.c)) for (let i = 0; i < user.c.length; i++) {
                        if (user.c[i]) results[client].corrects[i] = user.c[i];
                    } else results[client].corrects = user.c;
                }
            });
            window.dispatchEvent(new Event('resize')); // Fix React-Textfit not sizing right
            waitTimeout.current = setTimeout(function () {
                if (!standings.length) return;
                post("https://play.blooket.com/api/history", {
                    t: hostId.current,
                    standings: standings.map(({ b: blook, n: name, p: place, g: gold }) => ({
                        blook, name, place,
                        gold: isNaN(gold) ? 0 : Math.min(Math.round(Number(gold)), 9223372036854775000),
                        corrects: results[name]?.corrects || {},
                        incorrects: results[name]?.incorrects || {}
                    })),
                    settings: hostCopy.settings,
                    setId: hostCopy.setId
                }).then(({ data }) => {
                    setState(s => ({ ...s, historyId: data.id, ready: true }));
                    askTimeout.current = setTimeout(() => setAskPlayAgain(true), 3000);
                }).catch(console.error);
            }, 2000);
        }, 3500);
        return () => {
            clearTimeout(startTimeout.current);
            clearTimeout(waitTimeout.current);
            if (!restarting.current && liveGameController.liveGameCode && liveGameController.isHost) {
                liveGameController.removeHostAndDeleteGame();
                deleteHost();
            }
        }
    }, []);
    const onPlayAgain = useCallback(async (again) => {
        if (!again) {
            if (liveGameController.liveGameCode && liveGameController.isHost) {
                liveGameController.removeHostAndDeleteGame();
                deleteHost();
            }
            return setAskPlayAgain(false);
        }
        restarting.current = true;
        await liveGameController.removeVal("st");
        await liveGameController.removeVal("c");
        liveGameController.setStage({ stage: "join" }, () => navigate("/host/join"));
    }, []);
    if (host?.standings?.[0] || state.standings?.[0]) return <div className="body" style={{
        overflowY: state.ready ? "auto" : "hidden",
        backgroundImage: holidays.halloween ? null : `url(${images.castleTile})`,
        backgroundColor: holidays.halloween ? "#292929" : null,
        backgroundSize: 74.5
    }}>
        {state.standings.length > 0 && <Standings
            standings={state.standings}
            stats={state.standings.map(e => formatNumber(e.g) + (holidays.halloween ? " Candy" : " Gold"))}
            gameId={hostCopy.setId}
            historyId={state.historyId}
            muted={state.muted}
            theme={holidays.halloween ? "spooky" : holidays.lucky ? "shamrock" : "royal"}
            ready={state.ready}
        />}
        {askPlayAgain && <Modal text="Would you like to play again right now with the same settings?" buttonOne={{
            text: "Yes!",
            click: () => onPlayAgain(true)
        }} buttonTwo={{
            text: "No",
            click: () => onPlayAgain(false)
        }} />}
        {holidays.halloween && <Fog />}
    </div>;
}